        Information Statement from the NTWC","url":"http://ntwc.arh.noaa.gov/events/PAAQ/2014/08/24/nat3ek/1/SEUS71/SEUS71.txt","version":"01"},"preferredWeight":6,"contents":[]}],"impact-text":[{"indexid":"51055231","indexTime":1426175455096,"id":"urn:usgs-product:us:impact-text:usb000s5tp:1416621992000","type":"impact-text","code":"usb000s5tp","source":"us","updateTime":1416621992000,"status":"UPDATE","properties":{"eventParametersPublicID":"quakeml:us.anss.org/eventparameters/b000s5tp/1416621964","eventsource":"us","eventsourcecode":"b000s5tp"},"preferredWeight":6,"contents":{"":{"contentType":"text/plain","lastModified":1416621992000,"length":997,"bytes":"One
        person killed and at least 208 people injured, 150 buildings severely damaged
        and 1,000 buildings moderately damaged in Napa County. At least 49 people
        injured, 10 buildings severely damaged and 34 buildings moderately damaged
        in Solano County. Minor damage to several roads and several water main and
        gas line breaks in Napa and Solano Counties. Electricity and water services
        disrupted in Napa, Solano and Sonoma Counties. Six fires occurred in Napa
        County destroying at least 4 buildings. At least 8 km of surface faulting
        with at least 46 cm of right-lateral and 15 cm vertical displacements observed.
        The total economic loss estimated at 400 million U.S. dollars. Felt (VIII)
        at Napa; (VII) at American Canyon, Vallejo and Yountville; (VI) at Crockett,
        Deer Park, Glen Ellen, Port Costa, Rodeo and Sonoma. Felt in many parts of
        central and northern California from Arcata to Bakersfield. Felt (II) at Reno,
